import "../styles/home.css"
import CodeBlock from "../../components/codeblock/CodeBlock";


function HomeContent() {
    return (
        <div>
            <div>
                <p>Յուրաքանչյուր խոշոր բաց կոդով նախագիծ ունի իր ոճի ուղեցույցը.
                    մի շարք կոնվենցիաներ (երբեմն կամայական) այն մասին, թե ինչպես գրել կոդը այդ նախագծի համար:
                    Շատ ավելի հեշտ է հասկանալ մեծ կոդերի բազան, երբ դրանում առկա բոլոր ծածկագրերը համապատասխան ոճով են:
                </p>
            </div>
            <ul>
                <li><a href="/cpp">Cpp style guide</a></li>
                <li><a href="/python">Python style guide</a></li>
                <li><a href="/javascript">JavaScript style guide</a></li>
                <li><a href="/typescript">TypeScript style guide</a></li>
                <li><a href="/java">Java style guide</a></li>
                <li><a href="/html-css">HTML/Css style guide</a></li>
            </ul>
        </div>
  );
}

export default HomeContent;
